  `nombre` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Nombre de la actividad economica que se crea',
  `descripcion` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Detalle o razon de la actividad economica que se crea',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=383 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS tbl_usuario;
CREATE TABLE `tbl_usuario` (
  `id_usuario` int NOT NULL AUTO_INCREMENT COMMENT 'Codigo autoincremental del usuario',
  `email` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Correo del usuario para acceder a la plataforma del MIES',
  `full_name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Nombre completo del usuario',
  `no_identificacion` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Cedula o identificacion del usuario',
  `password` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Clave del usuario para acceder a la plataforma del MIES',
  `status` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Estado activo o inactivo de la cuenta del usuario',
  `create_time` datetime(6) DEFAULT NULL COMMENT 'Fecha de creacion de la cuenta del usuario',
  `last_login` datetime(6) DEFAULT NULL COMMENT 'Ultima vez en la que el usuario ha ingresado al sistema',
  `is_admin` tinyint(1) DEFAULT NULL,
  `id_rol` int NOT NULL COMMENT 'Codigo de tipo o rol que desempeña el usuario',
  PRIMARY KEY (`id_usuario`),
  UNIQUE KEY `no_identificacion` (`no_identificacion`),
  UNIQUE KEY `email` (`email`) /*!80000 INVISIBLE */,
  KEY `tbl_usuario_id_rol_d4e24117` (`id_rol`) /*!80000 INVISIBLE */,
  CONSTRAINT `fk_tbl_usuario_tbl_rol1` FOREIGN KEY (`id_rol`) REFERENCES `tbl_rol` (`id_rol`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS tbl_usuario_groups;
CREATE TABLE `tbl_usuario_groups` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `usuario_id` int NOT NULL,
  `group_id` int NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `tbl_usuario_groups_usuario_id_group_id_96d691b6_uniq` (`usuario_id`,`group_id`),
  KEY `tbl_usuario_groups_usuario_id_be0233c6` (`usuario_id`),
  KEY `tbl_usuario_groups_group_id_2f4bb2ae` (`group_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS tbl_usuario_user_permissions;
